import { Link } from 'react-router-dom';

const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Event 1',
    },
    {
        id: 'e2',
        title: 'Event 2',
    },
    {
        id: 'e4',
        title: 'Event 4',
    },
];

const EventsPage = () => {
    return (
        <>
            <ul>
                {DUMMY_EVENTS.map((event) => <li key={event.id}><Link to={`/events/${event.id}`}>{event.title}</Link></li>)}
            </ul>
        </>
    )
};

export default EventsPage;
